      | 365573 -> { ItemTypeData.id= 365573; name= "CreoDron Ion Pistol"; published= false; description= "A ruthlessly efficient close-quarters weapon, the ion pistol fires charged plasma munitions that rupture shields and scorch armor. Each discharge is enveloped in an electrostatic sheath that reduces field distortion and increases stability. The improved dispersion and stopping power is not without drawbacks though, as the higher density of each slug generates excessive heat, enough to seize the weapon if the rate of fire is not carefully controlled.    By overriding internal temperature controls, the weapon can be overcharged to produce a focused, bulk discharge of sufficient lethality to instantly neutralize most soft targets. Caution is advised however, as each overcharged shot will shut down internal systems until the excess heat can be flushed from the weapon’s core."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
