      | 367707 -> { ItemTypeData.id= 367707; name= "APEX 'Dragon' Scout"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     Building on recent advancements in biotic technology, this suit incorporates an array of cardiovascular augmentations that are automatically administered to the user in battle, improving overall stamina and reducing fatigue.     When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 367594; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 367998 -> { ItemTypeData.id= 367998; name= "Republic 'Warlord' Sentinel"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Based upon a deep-core construction exoskeleton, the Minmatar Sentinel is capable of withstanding some of the harshest conditions in the galaxy. Hardened shield systems and armor modifications improve its combat durability, while the various op-assist mechanisms used to augment movement make it second only to the Minmatar’s own Commando variant in terms of overall speed and mobility.    Heavy dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 367594; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
