      | 48383 -> { ItemTypeData.id= 48383; name= "Men's Triglavian Survival Suit (Veles)"; published= true; description= "This Triglavian survival suit bears the symbol of the Triglavian grouping called the  Veles Clade . CONCORD intelligence has established few hard facts about any of the clades but they are clearly major subdivisions within Triglavian society. The Veles Clade seems to be strong in the fields of heavy space industry, communications technology and high-energy exotic particle physics.    The Veles Clade also appears to emphasizes discourse within the Triglavian Collective, after a fashion, over strife – that is, if the evidence has been understood correctly. This Triglavian survival suit was probably sourced from the black market and care should be taken to ensure that the bioadaptive technology typically found in such items has been deactivated and removed."; marketGroupId= Some(1399); groupId= 1088; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 48577 -> { ItemTypeData.id= 48577; name= "Enforcer DED 'Master-at-Arms' Recruiter SKIN"; published= true; description= "CONCORD's Directive Enforcement Department is one of the leading military forces of New Eden. As such, the DED is equipped with top-of-the-line ships and its ranks are filled by skilled crews and enforcement troops.    The DED recruits from across New Eden and most major cities, colony outposts and space stations will have a DED recruitment and training facility commanded by a Master-at-Arms. When a DED Master-at-Arms travels they are entitled to bear the colors of their office on their ships.    A Master-at-Arms is usually provided with a Pacifier-class frigate but the more senior among their ranks can call on powerful vessels such as the Enforcer-class cruiser or the formidable Marshal-class battleship."; marketGroupId= Some(2362); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 48771 -> { ItemTypeData.id= 48771; name= "Triglavian Trinary Datastream HFN2"; published= true; description= "<i>Cladeships of the 3 tactical troika classification in communion militant of Zembog Subclade of Veles Clade encountered vessels under guidance of hivelinked foreign narodnya at reverse-time co-ordinates (indecipherable) while processing in sub-30 exclave of conduit loop construct-477. Invocation of the ancient-time accepted noema of extirpation of hivelinked narodnya proceeded but material realization was unacceptable. Entosis of hivelinked foreign narodnya into body of a 3 tactical troika classification cladeship commenced at reverse-time co-ordinates (indecipherable) and corrupted Narodnya of Zembog Subclade. The Koschoi of the tactical troika advised immolation. The Navka consented and invoked immolation at reverse-time co-ordinates (indecipherable).</i>     – Partial translation of Triglavian Trinary Datastream HFN2"; marketGroupId= Some(2480); groupId= 2002; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
