      | 49644 -> { ItemTypeData.id= 49644; name= "Black Dagger"; published= true; description= "A black dagger, typically constructed out of obsidian glass or dark iron, is an Amarrian implement used to mark a soul as corrupt. It is used most commonly in criminal sentencing performed by the Theology Council, which has the authority to convict a person accused of crimes against God, the Emperor or the Imperial Rite. The dagger is typically used to carve a symbol into the flesh to denote heretics, apostates, and those struck from the Amarr Book of Records.     A person marked with a black dagger by the Theology Council courts can never return to the Amarr faith in this world. The best such an excommunicate can hope for, if they have worked to redeem themselves, is mercy from God when they meet their final judgment. When a black dagger is used for executions, Amarr believe that the soul of the sentenced is sent to God bearing what is essentially a note from the executioner declaring that this person is irredeemable.    Black daggers are not the only ritual weapons used in Amarr. In ceremonies involving purification or atonement, Amarr priests use white-colored implements. Red daggers were once used in the ancient rites of the faith, in ceremonies of symbolic sacrifice and similar such rituals. The association with Sani Sabik heresies involving actual bloodletting has made such usage rare, although certain Sarumite sects continue to use red daggers in ceremonies of martial induction and the like."; marketGroupId= Some(1661); groupId= 1194; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 49741 -> { ItemTypeData.id= 49741; name= "Unstable Ballistic Control System Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter computer systems designed for monitoring and guiding missiles. As such this mutaplasmid could be used to mutate the performance characteristics of most ballistic control system.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool is highly unstable, with a high rate of reproduction and mutation. The mutational benefits of using this mutaplasmid are potentially very high but the risks are also extreme."; marketGroupId= Some(2517); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 49935 -> { ItemTypeData.id= 49935; name= "Zarmazd Hadean Horror SKIN"; published= true; description= "Entertainment corporations across New Eden have been quick to rush out new holoreel productions focusing on the Triglavians and Abyssal Deadspace. Be it Echelon Entertainment's patriotic  Abyssal Intruders , the Leisure Group's lurid  Triglavian Tryst , or the wildly popular  Hadean Horrors  from Impetus.    Using the special effects from  Hadean Horrors  as a template, a nanocoating and holographic package for the capsuleer market was developed for those pilots who have adopted Triglavian ship designs. This monstrous design lends a somewhat alien menace to ships it is applied to, enhancing the intimidating and aggressive look of Triglavian vessels."; marketGroupId= Some(2485); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
